import React, { useState, useEffect } from 'react'

function App() {
  const [books, setBooks] = useState([{}])

  useEffect(() => {
    fetch("/api")
      .then(res => res.json()).then(
        books => {
          setBooks(books)
          console.log(books)
        }
      )

  }, [])

  return (
    <div>
      {(typeof books.books !== 'undefined') ? (
        <p>Loading...</p>
      ) : (
        books.books.map(book => (
          <li>{book.title}</li>
        ))
      )}

    </div>
  )
}

export default App
